if (typeof sharedFunctions === 'undefined') {
  const sharedFunctions = true;

  // Helper function to extract item details from the text
  function extractItemDetails(text, action, characterName) {
    const regex = new RegExp(`${action} (.+) to ${characterName}'s inventory in (left hand|right hand|mouth|torso|waist) as (held|worn on strap|buckled on|stuck with glue|inserted loosely)`, 'i');
    const match = text.match(regex);
    return match ? { itemName: match[1], slot: match[2], connection: match[3] } : null;
  }

  // Helper function to extract NPC name from the text
  function extractNpcName(text) {
    const match = text.match(/(?:add|joins) (\w+) (?:to the team|joins your (party|team))/i);
    return match ? match[1] : null;
  }

  // Helper function to create a story card for an NPC
  function createStoryCard(npcName) {
    return {
      keys: npcName,
      value: `${npcName} is a new member of your party. They bring unique skills and abilities that will aid you in your quest.`,
      type: "character",
      title: npcName,
      description: `${npcName} has joined your party. They bring unique skills and abilities that will aid you in your quest.`,
      useForCharacterCreation: false
    };
  }

  // Helper function to find a character's story card
  function findCharacterCard(characterName) {
    return storyCards.find(card => card.title.toLowerCase() === characterName.toLowerCase());
  }

  // Helper function to get inventory from a character's description
  function getInventoryFromDescription(description) {
    const inventoryMatch = description.match(/Inventory:\s*(.*)/i);
    return inventoryMatch ? JSON.parse(inventoryMatch[1]) : {};
  }

  // Helper function to update character description with the new inventory
  function updateDescriptionWithInventory(description, inventory) {
    const updatedInventory = `Inventory: ${JSON.stringify(inventory)}`;
    return description.replace(/Inventory:\s*.*$/i, updatedInventory);
  }

  // Helper function to update the story card in the game
  function updateCharacterCard(characterCard) {
    const index = storyCards.findIndex(card => card.title.toLowerCase() === characterCard.title.toLowerCase());
    if (index > -1) {
      updateStoryCard(index, characterCard.keys, characterCard.value, characterCard.type, characterCard.title, characterCard.description);
    }
  }

  // This function adds an item to the character's inventory
  function addItemToInventory(characterName, itemName, slot, connection) {
    let characterCard = findCharacterCard(characterName);

    if (characterCard) {
      let inventory = getInventoryFromDescription(characterCard.description);
      inventory[slot] = { item: itemName, connection: connection };
      characterCard.description = updateDescriptionWithInventory(characterCard.description, inventory);
      updateCharacterCard(characterCard);
      state.message = `${itemName} has been added to ${characterName}'s ${slot} as ${connection}.`;
    } else {
      state.message = `Character card for ${characterName} not found.`;
    }
  }

  // This function removes an item from the character's inventory
  function removeItemFromInventory(characterName, itemName, slot) {
    let characterCard = findCharacterCard(characterName);

    if (characterCard) {
      let inventory = getInventoryFromDescription(characterCard.description);

      if (inventory[slot] && inventory[slot].item === itemName) {
        delete inventory[slot];
        characterCard.description = updateDescriptionWithInventory(characterCard.description, inventory);
        updateCharacterCard(characterCard);
        state.message = `${itemName} has been removed from ${characterName}'s ${slot}.`;
      } else {
        state.message = `${itemName} not found in ${characterName}'s ${slot}.`;
      }
    } else {
      state.message = `Character card for ${characterName} not found.`;
    }
  }

  // Helper function to detect and add clothing to the character's inventory
  function detectAndAddClothing(text, characterName) {
    const clothingRegex = /(?:wearing|dressed in|has on) (a|an|the)?\s*(.+?)\s*(in|on|at|around|over)?\s*(left hand|right hand|mouth|torso|waist)/i;
    const match = text.match(clothingRegex);

    if (match) {
      const itemName = match[2];
      const slot = match[4];
      const connection = 'worn'; // Default connection keyword for clothing
      addItemToInventory(characterName, itemName, slot, connection);
    }
  }
}

