  }

  const lowered = text.toLowerCase();
  if (typeof storyCards === 'undefined') {
    return { text: lowered }; // Return early if storyCards is undefined
  }

  const characterNames = storyCards.map(card => card.title.toLowerCase());

  characterNames.forEach(characterName => {
    if (lowered.includes(`add `) && lowered.includes(` to ${characterName}'s inventory`)) {
      const itemDetails = extractItemDetails(text, 'add', characterName);
      if (itemDetails) {
        const { itemName, slot, connection } = itemDetails;
        if (itemName && slot && connection) {
          addItemToInventory(characterName, itemName, slot, connection);
        } else {
          state.message = `Error: Could not extract item details from the text.`;
        }
      }
    } else if (lowered.includes(`remove `) && lowered.includes(` from ${characterName}'s inventory`)) {
      const itemDetails = extractItemDetails(text, 'remove', characterName);
      if (itemDetails) {
        const { itemName, slot } = itemDetails;
        if (itemName && slot) {
          removeItemFromInventory(characterName, itemName, slot);
        } else {
          state.message = `Error: Could not extract item details from the text.`;
        }
      }
    } else {
      detectAndAddClothing(text, characterName);
    }
  });

  if (lowered.includes('joins your party') || lowered.includes('joins your team') || lowered.includes('to the team')) {
    const npcName = extractNpcName(text);
    
    if (npcName) {
      const storyCard = createStoryCard(npcName);
      addStoryCard(storyCard.keys, storyCard.value, storyCard.type, storyCard.title, storyCard.description, storyCard.useForCharacterCreation);
      
      state.message = `${npcName} has been added to your party.`;
    } else {
      state.message = 'Error: Could not extract NPC name from the text.';
    }
  }

  return { text };
};

